import './App.css';
import { sampleData } from './backend';
import { CsvToHtmlTable } from 'react-csv-to-table';

function App() {

  const handelOnFileLoad = (sampleData) => {
    console.log(sampleData)
  }
  return (
    <>
      <Input />
      <div className="App" style={{ display: "flex", justifyContent: "center" }}>
        <Notes />
      </div>
    </>
  );
}
function Notes() {
  const noteRootStyle = {
    border: "2px #0af solid",
    borderRadius: 9,
    margin: 20,
    backgroundColor: "#efefef",
    padding: 9
  };
  function Input() {
    <form>
      <label>
        <input type="text" name="name" />
      </label>
      <input type="submit" value="Submit" />
    </form>
  }
  return (
    <div >
      <CsvToHtmlTable
        data={sampleData}
        csvDelimiter=","
        tableClassName="table table-striped table-dark table-bordered"
      />
    </div>
  )
}
export default App;
